import './App.css';
import Header from './components/Header';
import CurrentLocation from './components/CurrentLocation';
import { useEffect, useState } from 'react';




function Main(wmoCode)
{
//wmoCode it use a code to tract an application ..so the code has a code
//here i am passing wmoCODE

//first we deal with the currnt location situation
//alrigth i am going to use WMO(weather interpretation code)
//niw i must trnalste the wmo to what the icons will be acccesed
const weatherIcons = [
  { code: [0], icon: "‚òÄÔ∏è" },           // Clear sky
  { code: [1], icon: "üå§" },            // Mainly clear
  { code: [2], icon: "‚õÖÔ∏è" },           // Partly cloudy
  { code: [3], icon: "‚òÅÔ∏è" },           // Overcast
  { code: [45], icon: "üå´" },           // Fog
  { code: [48], icon: "üåÅ" },           // Depositing rime fog
  { code: [51], icon: "üå¶" },           // Drizzle: Light intensity
  { code: [53], icon: "üåß" },           // Drizzle: Moderate intensity
  { code: [55], icon: "üåßÔ∏è" },          // Drizzle: Dense intensity
  { code: [56], icon: "üåß" },           // Freezing Drizzle: Light intensity
  { code: [57], icon: "üåßÔ∏è" },          // Freezing Drizzle: Dense intensity
  { code: [61], icon: "üå¶" },           // Rain: Slight intensity
  { code: [63], icon: "üåß" },           // Rain: Moderate intensity
  { code: [65], icon: "üåßÔ∏è" },          // Rain: Heavy intensity
  { code: [66], icon: "üå®" },           // Freezing Rain: Light intensity
  { code: [67], icon: "üå®Ô∏è" },          // Freezing Rain: Heavy intensity
  { code: [71], icon: "üå®" },           // Snow fall: Slight intensity
  { code: [73], icon: "üå®" },           // Snow fall: Moderate intensity
  { code: [75], icon: "üå®Ô∏è" },          // Snow fall: Heavy intensity
  { code: [77], icon: "‚ùÑÔ∏è" },          // Snow grains
  { code: [80], icon: "üåß" },           // Rain showers: Slight intensity
  { code: [81], icon: "üåßÔ∏è" },          // Rain showers: Moderate intensity
  { code: [82], icon: "üåßÔ∏è" },          // Rain showers: Violent intensity
  { code: [85], icon: "üå®" },           // Snow showers: Slight intensity
  { code: [86], icon: "üå®Ô∏è" },          // Snow showers: Heavy intensity
  { code: [95], icon: "üå©" },           // Thunderstorm: Slight or moderate
  { code: [96], icon: "‚õàÔ∏è" },          // Thunderstorm with slight hail
  { code: [99], icon: "‚õàÔ∏è" },          // Thunderstorm with heavy hail
  { code: [21], icon: "üå¨Ô∏è" },          // Breezy conditions
  { code: [22], icon: "üå™Ô∏è" },          // Tornado
  { code: [31], icon: "üå´Ô∏è" },          // Mist
  { code: [32], icon: "üåÅ" },           // Dense fog
  { code: [41], icon: "üå§Ô∏è" },          // Partly sunny
  { code: [42], icon: "‚õÖÔ∏è" },          // Intermittent clouds
  { code: [43], icon: "üå•Ô∏è" },          // Mostly cloudy
  { code: [51, 52], icon: "üåß" },       // Light rain or drizzle
  { code: [54], icon: "üåßÔ∏è" },          // Heavy drizzle
  { code: [62], icon: "üåßÔ∏è" },          // Steady rain
  { code: [83], icon: "üå®Ô∏è" },          // Hail showers
  { code: [84], icon: "üå®" },           // Sleet
];


function getWeatherIcon(wmoCode) {
  // Use the find() method to search through the weatherIcons array
  const match = weatherIcons.find(item => item.code.includes(wmoCode));

  // If a matching WMO code is found, return the corresponding icon
  // If not found, return a default "‚ùì" icon indicating an unknown weather condition
  return match ? match.icon : "‚ùì";
}
}

//chnaging the date into names
function ChangeTheDate(datestr){
  const date = new Date(datestr);//this brings the actual data with laptop format
  return date.toLocaleString('en-US', { weekday: 'short' });//Mon,Tu,wed
  //when u return you prevent to define
}
console.log(ChangeTheDate(22-12-2023))//it is working


function App() {
  const [name, setName] = useState(""); // State for the location name
  const [isLoading, setIsLoading] = useState(false); // State for loading status

  async function fetchWeather() {
    try {
      setIsLoading(true); // Set loading status to true while fetching data

      const geoRes = await fetch(
        `https://geocoding-api.open-meteo.com/v1/search?name=${name}`
      );
      const geoData = await geoRes.json();

      // Handle the fetched data (this part is missing in your code)
      console.log(geoData); // Just for debugging; you can process this data as needed

      // Further code to fetch weather data using latitude and longitude from geoData
    } catch (error) {
      console.error("Error fetching weather data:", error); // Handle any errors
    } finally {
      setIsLoading(false); // Set loading status back to false after fetching
    }
  }

  return (
    <div className="App">
      <Header name={name} setName={setName} /> {/* Pass state and state setter as props */}
      <h1>Get weather update here</h1>
      <CurrentLocation />
      {/* Optionally, add a button or useEffect to trigger fetchWeather */}
    </div>
  );
}

export default App;
